import React from "react";
import styles from './NavLink.module.css'
import { Link } from 'react-router-dom';

const NavLink = ({ name, to }) => { 
    let match = useRouteMatch({
    path: to,
    exact: activeOnlyWhenExact
  });
}

export default NavLink;
